export function add45(a: number, b: number): number {
  return a + b;
}

export function subtract45(a: number, b: number): number {
  return a - b;
}

export function multiply45(a: number, b: number): number {
  return a * b;
}

export function divide45(a: number, b: number): number {
  return a / b;
}
